import React, { useState, useEffect } from 'react';
import './App.css';

const App: React.FC = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isCookieConsentVisible, setIsCookieConsentVisible] = useState(true);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const navbar = document.querySelector('.navbar');
      if (navbar) {
        if (window.scrollY > 50) {
          navbar.classList.add('navbar-scrolled');
        } else {
          navbar.classList.remove('navbar-scrolled');
        }
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleContactSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setIsLoading(true);
    // Simulate form submission
    await new Promise(resolve => setTimeout(resolve, 1000));
    setIsLoading(false);
    alert('Thank you for your message! We will get back to you soon.');
  };

  return (
    <div className="app">
      {/* Navigation */}
      <nav className="navbar">
        <div className="navbar-brand">
          <div className="logo">
            <svg className="octopus" viewBox="0 0 100 100" width="50" height="50">
              <circle cx="50" cy="50" r="20" fill="#FF6B6B" />
              <circle cx="45" cy="45" r="5" fill="#4ECDC4" />
              <circle cx="55" cy="45" r="5" fill="#4ECDC4" />
              {[...Array(8)].map((_, i) => (
                <path
                  key={i}
                  d={`M ${50 + 20 * Math.cos((i * Math.PI) / 4)} ${
                    50 + 20 * Math.sin((i * Math.PI) / 4)
                  } Q ${50 + 30 * Math.cos((i * Math.PI) / 4)} ${
                    50 + 30 * Math.sin((i * Math.PI) / 4)
                  } ${50 + 40 * Math.cos((i * Math.PI) / 4)} ${
